import React from 'react';
import {useEffect, useState} from 'react';
import './Project.scss';
import GalleryData from './../workData/Data';


export default function Project() {

  const [data, setData] = useState([]);

  useEffect(()=>{
    setData(GalleryData);
  },[])

  console.log(GalleryData.image);
  

  return (
    <section className='projects' id='projects'>
        <div className="project-container">
          <div className="heading-project">Projects</div>

          <div className="selection">
            <div className="list">All</div>
            <div className="list">UI/UX</div>
            <div className="list">Website</div>
            <div className="list">Coding</div>
          </div>

          <div className="gallery">
  
            {data.map((item)=>
              <div className="card-holder" key={item.id}>
                <div className="card">
                  <h2 className="item-name">{item.title}</h2>
                  <img src={item.image} alt="project item" />
                  <div className="item-dis">{item.desc}</div>

                </div>
              </div>
  
            )}


          </div>
        </div>
        
    </section>
  )
}
